    return <>
        <table>
            <tr>
                <td className="text-sm text-grey-500">324</td>
                <td className="text-2xl">오피니언의 게시글 제목이 들어 가는 부분입니다.</td>
                <td className="text-sm text-grey-500">비트생성기</td>
                <td className="text-sm text-grey-500">2020.07.29</td>
                <td className="text-sm text-grey-500">조회수 84</td>
            </tr>
        </table>

        <input className={"form-input"} placeholder={"#키워드 입력"} type="text"/>
