            <button className="btn btn-default bg-transparent hover:bg-blue-50 text-blue-500 hover:text-blue-600 btn-rounded btn-raised"><Link to="opinionList">돌아가기</Link></button>
        </div>
    </>
}

export default OpinionDetail;
